import React, { Component } from 'react';
import axios from 'axios';
import withStyles  from '@material-ui/core/styles/withStyles';

import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';

const styles = {
    Card:{
        padding: 20,
        marginBottom:20,
    }
}

class Post extends Component {


    render() {
        const classes = this.props;
        var posts;
        var userHandle, body, createdAt;
        console.log(this.props,"this.props from Post.js");
        userHandle = this.props.post.userHandle;
        body = this.props.post.body;
        createdAt = this.props.post.createdAt.toString();
        
        return (
            <Card className = {classes.card}>
                <Typography variant="bod1" color="primary">{userHandle}</Typography>
                <Typography variant="body2">{body}</Typography>
                <Typography variant="body2" color ="textSecondary">{createdAt}</Typography>
            </Card>
        
        )
    }
}

export default withStyles(styles)(Post);
